ターミネーター4 10インチアクションフィギュア #04/T-700【コレクターシリーズ】<br>
<table width="700" border="0" cellspacing="0"><tr bgcolor="#FFFFFF">
<td bgcolor="65614F" height="36"><font size="+2" color="#FFFFFF" face="Georgia"><b>Terminator 
4 - Collector Series 10 Inch:<br>
Action Figure #04 - T-700</b></font></td>
</tr><tr bgcolor="C5BD97"><td bgcolor="C5BD97" height="2" valign="top"></td></tr><tr><td bgcolor="#000000"><div align="center"><br><br><br><table width="600" border="1" cellpadding="10" bordercolor="C5BD97"><tr><td><font size="4" color="#FF6600"><b>人間を救うか、撲滅するか、あなたが決める。</b></font><br><br>
<font size="2" color="#CCCCCC">プレイメイツ・トイズ社の『ターミネーター４』ラインナップに、ターミネーターＴ－７００が「コレクターシリーズ」の10インチサイズアクションフィギュアで登場！ 
　スカイネットは、人類軍の強固な抵抗に終止符を打つために、Ｔ－６００より滑らかに動き、よりスリムになり人間に近づいた新型のターミネーターＴ－７００を開発した。全高約25センチのフィギュアは、目が光るライトアップ機能付き。<br>
<br>
　『ターミネーター４』アイテムを揃えて、人類の未来を左右するさまざまな戦闘シーンを再現しようではないか。人類の未来はあなたの手の中にある。 
※ＬＲ４１ボタン型電池２個使用。（電池付き）</font></td>
</tr></table><br>
<img alt="1/1スケール ターミネーター4 T-600 声変換スカル" src="http://image.rakuten.co.jp/ustoy/cabinet/terminator/ht600928-2.jpg"><br>
