：</font></td><td width="514" bgcolor="65614F" height="11"><font size="-1" color="#FFFFFF">4580279600928</font></td></tr></tbody></table></td></tr></table><br><br><hr><font size="2" color="#999999"><b>『ターミネーター４』（2009年作品）</b><br></font><font size="2" color="#999999">舞台は２０１８年、核戦争後の荒廃した世界。人類と機械の壮絶な戦いが繰り広げられる中、スカイネットはいよいよ、生き残ったわずかな人類に対する最後の総攻撃を仕掛けようとしていた。一方、レジスタンスのリーダーとなったジョン・コナーは、過去の記憶を持たないマーカス・ライトという謎の男と出会う。ジョンはマーカスと行動を共にし、スカイネットの活動の核心に迫ってゆくが、そこには驚愕の秘密が隠されていた。</font></div></td></tr><tr><td bgcolor="#000000" height="2"></td></tr></table><style type="text/css">
